'use strict';

/*
    This file can be used as entry point for webpack!
 */

wow = new WOW({
    offset: 50,
    mobile: false
})
wow.init();

$(function() {
    $('.preloader_bg').delay(10).fadeOut(300);
    $('.preloader_content').delay(10).fadeOut(300);
});















$(function(){
	$(".header-nav-toggler").on('click', function(){
		$(this).toggleClass("active");
		$(".header-overlay").toggleClass("menu-open");
		$(".header-nav").toggleClass("open");
	});
	
	$('a[href ^= "#"]').click(function () {
		$(".navigation__elem").removeClass('navigation__elem_active');
		$(this).parent().addClass('navigation__elem_active');
		var elementClick = $(this).attr("href");
		var destination = $(elementClick).offset().top;
		$('html,body').animate( { scrollTop: destination }, 1000 );
		return false;
	});
})


$(function(){
	var mySwiper = new Swiper ('.swiper-container', {
		scrollbar: ".offerCard-scrollbar",
		scrollbarHide: false,
		scrollbarDraggable: true,
		slidesPerView: 5,
		breakpoints: {
			480: {
				slidesPerView: 1
			},
			680: {
				slidesPerView: 2
			},
			860:{
				slidesPerView: 3
			},
			1170: {
				slidesPerView: 4
			}
		}
    })  
})









